import React from 'react';

const Socials = () => {
    return (
        <>
            <a className='fb social' href='#'><i className='fab fa-2x fa-facebook-square'></i></a>
            <a className='insta social' href="#"><i className='fab fa-2x fa-instagram-square'></i></a>
            <a className='twitter social' href='#'><i className='fab fa-2x fa-twitter-square'></i></a>    
            <a className='gmail social' href='#'><img src='./logoGmail.png' alt='Logo Gmail'/> </a>     
        </>
    );
};

export default Socials;
